import { Component } from '@angular/core';

@Component({
  selector: 'app-modal',
  templateUrl: './modal.component.html',
  styleUrls: ['./modal.component.css']
})
export class ModalComponent {
  status: boolean = false;
  clickEvent(){
      this.status = !this.status;       
  }
}
